Drupal.behaviors.ucCustomerOrder={attach:function(a,b){jQuery(".uc-customer-table tr.odd, .uc-customer-table tr.even:not(.ucCustomerOrder-processed)",a).addClass("ucCustomerOrder-processed").each(function(){jQuery(this).dblclick(function(){window.location=b.basePath+"?q=admin/store/customers/orders/"+this.id.substring(9);});});}};Drupal.behaviors.ucCustomerOrders={attach:function(a,b){jQuery(".uc-cust-orders-table tr.odd, .uc-cust-orders-table tr.even:not(.ucCustomerOrders-processed)",a).addClass("ucCustomerOrders-processed").each(function(){jQuery(this).dblclick(function(){window.location=b.basePath+"?q=admin/store/orders/"+this.id.substring(6);});});}};